import { json } from "react-router-dom";
import BImg from "./images/BooksImg"

const Books = () => {
  const [books, setBooks] = useState([]);

  useEffect(() => {
    try{
    fetch("http://localhost:8080/books", {

      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    })
      .then(function() {
        return json();
      })
      .then(function(data) {
        console.log("server response is ", data);
      });
    }
    catch{
      console.error("Error in Client side");
    }
  }, [books]);

  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <table className="table table-grid-box">
            <tr>
            </tr>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Books;
